<template>
  <div id="examine">
    <el-table
        :data="tableData"
        style="width: 100%"
        max-height="100vh">
        <el-table-column
        fixed
        prop="name"
        label="申请人"
        width="200">
        </el-table-column>
        <el-table-column
        prop="content"
        label="文案内容"
        width="250"
        align="center">
        </el-table-column>
        <el-table-column
        prop="date"
        label="申请时间"
        width="350"
        align="center">
        </el-table-column>
        <el-table-column
        fixed="right"
        label="操作"
        width="200"
        align="center">
        <template slot-scope="scope">
            <el-button
            @click.native.prevent="examine(scope.$index, tableData)"
            type="text"
            size="small">
            查看详情
            </el-button>
        </template>
        </el-table-column>
    </el-table>
    <el-dialog
        :title="this.dialogTitle"
        :visible.sync="dialogVisible1"
        width="30%"
        center>
        <div style="text-align:center; margin-bottom:5%">{{dialogText}}</div>
        <el-image
            style="width: 100%; height: 200px"
            :src="this.tableData[indexNow].img"
            fit="fill"></el-image>
        <span slot="footer" class="dialog-footer">
            <el-button @click="dialogVisible2 = true">驳 回</el-button>
            <el-button type="primary" @click="pass()">通 过</el-button>
        </span>
        <el-dialog
            width="30%"
            title="驳回理由"
            :visible.sync="dialogVisible2"
            append-to-body>
            <el-input
                type="textarea"
                :autosize="{ minRows: 12, maxRows: 15}"
                placeholder="请输入内容"
                v-model="reason">
            </el-input>
            <div id="btn">
                <el-button style="width:40%" type="info" round @click="reject()">驳回</el-button>
            </div>
        </el-dialog>
    </el-dialog>
  </div>
</template>

<script>
export default {
    methods: {
      examine(index, rows) {
        this.dialogVisible1 = true;
        this.dialogTitle = this.tableData[index].name
        this.dialogText = this.tableData[index].content
        this.indexNow = index
        console.log(index, rows)
      },
      reject() {
        console.log(this.indexNow)
        this.axios({
            method:'post',
            url:'/authority/rfc59fre',
            data: {
                reportReason: this.reason,
                taskIndex: this.tableData[this.indexNow].taskIndex,
                teamId: this.tableData[this.indexNow].id
            }
        })
        .then((response => {
            if(response.data.code == 200){
                this.dialogVisible2 = false 
                this.tableData.splice(this.indexNow, 1)
            }
        }))
        .catch((error) => {
            console.log(error)
        })
      },
      pass() {
        this.axios({
            method:'post',
            url:'/backend/submit/pass',
            data: {
                taskIndex: this.tableData[this.indexNow].taskIndex,
                teamId: this.tableData[this.indexNow].id
            }
        })
        .then((response => {
            if(response.data.code == 200){
                this.dialogVisible1 = false
                this.tableData.splice(this.indexNow, 1)
            }
        }))
        .catch((error) => {
            console.log(error)
        })
      }
    },
    data() {
      return {
        dialogVisible1: false,
        dialogVisible2: false,
        dialogTitle: '',
        dialogText: '',
        indexNow: 0,
        reason:'',
        tableData: [{
          id: -1,
          taskIndex: -1,
          date: '1145-14-19',
          name: '田所 浩二',
          content: '哼哼哼啊啊啊啊啊啊',
          img: ''
        },]
      }
    },
    mounted() {
        if(!localStorage.token){
            this.$router.replace('/login')
        }
        this.axios({
            method:'post',
            url:'/backend/info/work',
            data: {
                token: localStorage.token
            }
        })
        .then((response => {
            console.log(response.data.data)
            let info = new Object()
            info.id = response.data.data.teamId
            info.taskIndex = info.id = response.data.data.taskIndex
            info.name = response.data.data.teamName
            info.date = response.data.data.finish_date
            info.content = response.data.data.myDescription
            info.img = "data:image/jpeg;base64," + response.data.data.uploadLocation
            this.tableData.push(info)
        }))
        .catch((error) => {
            console.log(error)
        })
        let info = new Object()
        info.date = 114
        info.name = "514"
        info.content = 1919810
        info.img ="data:image/jpeg;base64," + ""
        this.tableData.push(info)
    }
  }
</script>

